import "./App.css";
import { Routes, Route, BrowserRouter as Router } from "react-router-dom";
import Dashboard from "./Dashboard";
import {
  Card,
  CardContent,
  Typography,
  Button,
  CardMedia,
} from "@mui/material";
import { useTheme } from "@mui/material/styles";
import MobileStepper from "@mui/material/MobileStepper";
import KeyboardArrowLeft from "@mui/icons-material/KeyboardArrowLeft";
import KeyboardArrowRight from "@mui/icons-material/KeyboardArrowRight";
import React, { useEffect, useState } from "react";
import { createTheme, ThemeProvider } from '@mui/material/styles';

// Create a theme instance.
const theme = createTheme({
  palette: {
    primary: {
      main: '#4B34A2',
    },
    secondary: {
      main: '#EDD83D',
      contrastText: '#6AB547',
      dark: '#A5C4BD'
    },
  },
});



const projects = [
  {
    title: "Project 1",
    description: "This is the description for project 1.",
    imageUrl:
      "https://images.pexels.com/photos/416405/pexels-photo-416405.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2s",
  },
  {
    title: "Project 2",
    description: "This is the description for project 2.",
    imageUrl:
      "https://images.pexels.com/photos/3183150/pexels-photo-3183150.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2",
  },
  {
    title: "Project 3",
    description: "This is the description for project 3.",
    imageUrl:
      "https://images.pexels.com/photos/941555/pexels-photo-941555.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2",
  },
  {
    title: "Project 4",
    description: "This is the description for project 3.",
    imageUrl:
      "https://images.pexels.com/photos/941555/pexels-photo-941555.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2",
  }, // Add more projects as needed
  {
    title: "Project 5",
    description: "This is the description for project 3.",
    imageUrl:
      "https://images.pexels.com/photos/941555/pexels-photo-941555.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2",
  },
  {
    title: "Project 6",
    description: "This is the description for project 3.",
    imageUrl:
      "https://images.pexels.com/photos/941555/pexels-photo-941555.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2",
  },
];

const HorizontalScrollList = () => {
  return (
    <div
      style={{
        display: "flex",
        overflowX: "auto",
        gap: "16px",
        padding: "16px",
      }}
    >
      {projects.map((project, index) => (
        <Card
          key={index}
          style={{
            width: "250px",
            height: "140px",
            flexShrink: 0,
          }}
        >
          <CardMedia
            component="img"
            height="90"
            image={project.imageUrl}
            alt={project.title}
          />
          <CardContent>
            <Typography variant="h5" component="div">
              {project.title}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              {project.description}
            </Typography>
          </CardContent>
        </Card>
      ))}
    </div>
  );
};

const App = () => {
  return (
    <div className="App">
      <h1>My Projects</h1>
      <HorizontalScrollList />
      {/* Other components or content can be added here */}
    </div>
  );
};
export default App;
